LEO 🆚 AURORA

 Now, that aurora is almost 2 I can compare a boy and a girl up to this age, let’s look

 Leo:
 ➕ Leo's pregnancy was easy, almost no nausea and heartburn;
 ➕ the newborn Leonardo slept peacefully at night, he could wake up only 1 time to eat and he loved pacifier ( that helped a lot with my sleep)
 ➖At the age of 2, began a difficult period - tantrums, screams, it was almost impossible to handle him.  Most of the time he achieved what he wanted and demanded;
 ➖Leonardo is not a good eater (he want just pasta), he picks out all the vegetables even if i disguise them🙈

 Aurora:
 ➖pregnancy was much more difficult - terrible nausea, heartburn. I vomited throughout all my pregnancy, like in a movie.  it was terrible;
 ➖ she could not sleep without a boob, did not take a pacifier or a bottle! what helped me don’t sleep for 2 years;
 ➕at 2 years old it is much easier to negotiate with Aurora.  She also defends her interests, but mamas kisses fixes everything ;
 ➕Aurora eats well! She love food so much! Broccoli and avocado is her favorite:) 

Do you think it depends on gender or is it just different personalities?

